import ToDoApp from './ToDoApp'

const weatherData = {
  currentCity: "Cleveland",
  description: "Sunny",
  temperature: 76
}

//

function App() {
  return (
    <div>
      Hello React
      <ToDoApp 
        name="Tim" 
        currentCity={weatherData.currentCity} 
        description={weatherData.description}
        temperature={weatherData.temperature}
      /> 
    </div>
  );
}

export default App;
